import React, { Component } from "react";
import axios from "axios";

class Logout extends Component {

    constructor(props) {
        super(props);
    }

    componentDidMount() {
        axios.post("http://localhost:4000/logout");

        this.props.history.push("/");
      }
}

export default Logout;
